import PropTypes from 'prop-types'

const Logo=({logo,title})=>{
      
    return( 
        <div CL>
            <img src={logo} title={title}  />
             {title}
        </div>
    )
}

Logo.propTypes={
    title:PropTypes.string,
    logo:PropTypes.string
}

Logo.defaultProps={
     title:"CORONA APP",
     logo:""
}

export default Logo
